class Solution {
    public List<Integer> addToArrayForm(int[] num, int k) {
        //用LinkedList不断从头将位数和加入index 0
        List<Integer> res = new LinkedList<>();
        int n = num.length;
        for (int i = n - 1; i >= 0; i--) {
            //从末尾往前扫，加和取余的值
            res.add(0, (num[i] + k) % 10);
            //更新k存进位carry
            k = (num[i] + k) / 10;
        }

        // post-possing: 处理k位数大于num的情况剩下的部分
        // Time = O(log(k))
        while (k > 0) {
            res.add(0, k % 10);
            k /= 10;
        }

        return res;
    }
}

