func addToArrayForm(num []int, k int) []int {
	kstr := strconv.Itoa(k)
	var kArr []int
	var res []int
	var sum, reminder, carry int
	for i := 0; i < len(kstr); i++ {
		v, _ := strconv.Atoi(string(kstr[i]))
		kArr = append(kArr, v)
	}
	reverseSlice(kArr)
	reverseSlice(num)
	for i, j := 0, 0; i < len(num) || j < len(kArr); {
		if i >= len(num) { // num out of index
			sum = carry + kArr[j]
			j++
		} else if j >= len(kArr) { // kArr out of index
			sum = carry + num[i]
			i++
		} else { // num and kArr are both in range
			sum = carry + num[i] + kArr[j]
			i++
			j++
		}
		carry = sum / 10
		reminder = sum % 10
		res = append(res, reminder)
	}
	if carry > 0 {
		res = append(res, carry)
	}
	reverseSlice(res)
	return res
}

func reverseSlice(num []int) {
	for i, j := 0, len(num)-1; i < j; i, j = i+1, j-1 {
		num[i], num[j] = num[j], num[i]
	}
}
