# 思路
先将k转成数组，再利用双指针分别从k和num的最后一位开始按位计算。注：需要考虑最后一次进位的情况。

# 代码
javascript

```javascript
/*
 * @lc app=leetcode.cn id=989 lang=javascript
 *
 * [989] 数组形式的整数加法
 */

// @lc code=start
/**
 * @param {number[]} num
 * @param {number} k
 * @return {number[]}
 */
var addToArrayForm = function(num, k) {
  const kArr = (k + '').split('')
  let temp = 0
  const ret = []
  let i = num.length - 1
  let j = kArr.length - 1
  while(i >= 0 || j >= 0) {
    const sum = (num[i] || 0) + parseInt(kArr[j] || 0) + temp
    ret.unshift(sum % 10)
    temp = parseInt(sum / 10)
    i--
    j--
  }
  if (temp) {
    ret.unshift(temp)
  }

  return ret
};
// @lc code=end

```

# 复杂度分析
时间复杂度：O(max(n, log k))，其中 n 为数组的长度。log k为k的位，即log 10(k)，10为底k的对数。
空间复杂度：O(max(n, log k))。

