// 思路，类似与归并排序，num数组末尾与k末尾数字相加，记录进位carray，插入到列表头
class Solution {
    public List<Integer> addToArrayForm(int[] num, int k) {
        LinkedList<Integer> sum = new LinkedList<>();
        int i = num.length - 1;
        int carry = 0;
        while (i >= 0 || k > 0) {
            if (i >= 0) {
                carry += num[i--];
            }
            if (k > 0) {
                carry += k%10;
                k /= 10;
            }
            sum.addFirst(carry % 10 );
            carry /= 10;
        }
        if (carry > 0) {
            sum.addFirst(carry);
        }
        return sum;
    }
}
